import React from "react";

// CSS
import './Homepage.css';

const Homepage = () => {
  return (
    <div className="home_content">
      <h1 className="home_title">Been+On</h1>
      <p id="home_content">Keep track of your progress here</p>
      <button>Start</button>
    </div>
  );
};

export default Homepage;
